//Удаляем схему данных полностью (если она существует)
DROP DATABASE kameleoon;
//Создание схемы данных
CREATE DATABASE kameleoon
    WITH
    OWNER = postgres
    ENCODING = 'UTF8'
    CONNECTION LIMIT = -1;

COMMENT ON DATABASE kameleoon
    IS 'For testing task';

//Создание таблицы пользователей
CREATE TABLE public.kameleoon_user
(
    id bigserial NOT NULL,
    user_name character varying(20) NOT NULL,
    user_password character varying(20) NOT NULL,
    create_date timestamp with time zone NOT NULL,
    change_date timestamp with time zone,
    comm character varying(1000),
    CONSTRAINT user_pk PRIMARY KEY (id),
    CONSTRAINT username_uk UNIQUE (user_name)
);

ALTER TABLE public.kameleoon_user
    OWNER to postgres;

//Создвние таблицы квот
CREATE TABLE public.quote
(
    id bigserial NOT NULL,
    name character varying(15) NOT NULL,
    comm character varying(150),
    create_user bigint NOT NULL,
    create_date timestamp with time zone NOT NULL,
    change_user bigint,
    change_date timestamp with time zone,
    CONSTRAINT quote_pk PRIMARY KEY (id),
    CONSTRAINT quote_change_user_fk FOREIGN KEY (change_user)
        REFERENCES public.kameleoon_user (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID,
    CONSTRAINT quote_create_user_fk FOREIGN KEY (create_user)
        REFERENCES public.kameleoon_user (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID
);

//Таблица значений квот
CREATE TABLE public.quote_values
(
    id bigserial NOT NULL,
    quote bigint NOT NULL,
    value numeric NOT NULL,
    value_date timestamp with time zone NOT NULL,
    CONSTRAINT quote_value_pk PRIMARY KEY (id),
    CONSTRAINT quote_fk FOREIGN KEY (quote)
        REFERENCES public.quote (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
        NOT VALID
);

ALTER TABLE public.quote_values
    OWNER to postgres;

ALTER TABLE public.quote
    OWNER to postgres;

